import React, { useState } from 'react';
import axios from 'axios';  
import { useNavigate } from "react-router"; 
import Cookies from 'js-cookie';        
import Swal from 'sweetalert2';                 
import teamLogo from './1ds.png'; // Import the local image    


function Report() {                 
  const [reportType, setReportType] = useState(''); 
  const [description, setDescription] = useState('');
  const [isSubmitting, setIsSubmitting] = useState(false);
  const navigate = useNavigate();

  const handleReportTypeChange = (e) => {
    setReportType(e.target.value);
  };

  const handleDescriptionChange = (e) => {
    setDescription(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setIsSubmitting(true);

    const token = Cookies.get('token');
    if (!token) {
      Swal.fire({
        icon: 'error',
        title: 'Lỗi',
        text: 'Bạn cần đăng nhập để gửi báo cáo',
      });
      navigate('/login');
      return;
    }

    axios.post('http://localhost:5000/report', {
      reportType,
      description
    }, {
      headers: {
        'Authorization': `Bearer ${token}`
      }
    })
    .then(response => {
      Swal.fire({
        icon: 'success',
        title: 'Thành công',
        text: 'Báo cáo của bạn đã được gửi',
      });
      setReportType('');
      setDescription('');
    })
    .catch(error => {
      console.error('Error submitting report:', error);
      Swal.fire({
        icon: 'error',
        title: 'Lỗi',
        text: 'Không thể gửi báo cáo của bạn',
      });
    })
    .finally(() => {
      setIsSubmitting(false);
    });
  };

  return (
    <div style={{ height: '100vh', overflow: 'hidden' }}>
      <header style={{ backgroundColor: '#eef1f3', display: 'flex', alignItems: 'center', fontFamily: '"Playwrite Hrvatska Lijeva", Arial, sans-serif', fontSize: '40px', margin: '20px 0', justifyContent: 'center' }}>
        <img src={teamLogo} alt="Team Logo" style={{ marginRight: '20px', width: '10%', height: '10%', cursor: 'pointer' }} onClick={() => navigate('/')} />
        <div style={{ textAlign: 'center', display: 'flex', alignItems: 'center', cursor: 'pointer' }} onClick={() => navigate('/')}>
          <span>Report Issue</span>
        </div>
        <img src={teamLogo} alt="Team Logo" style={{ marginLeft: '20px', width: '10%', height: '10%', cursor: 'pointer' }} onClick={() => navigate('/')} />
      </header>
      <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: 'calc(100vh - 80px)' }}>
        <form onSubmit={handleSubmit} style={{ width: '50%', backgroundColor: '#fff', padding: '20px', borderRadius: '8px', boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)' }}>
          <h2 style={{ textAlign: 'center', marginBottom: '20px' }}>Report an Issue</h2>
          <div style={{ marginBottom: '20px' }}>
            <label htmlFor="reportType" style={{ display: 'block', marginBottom: '5px' }}>Report Type:</label>
            <select id="reportType" value={reportType} onChange={handleReportTypeChange} style={{ width: '100%', padding: '10px', borderRadius: '4px', border: '1px solid #ddd' }}>
              <option value="">Select a type</option>
              <option value="bug">Bug</option>
              <option value="feedback">Feedback</option>
            </select>
          </div>
          <div style={{ marginBottom: '20px' }}>
            <label htmlFor="description" style={{ display: 'block', marginBottom: '5px' }}>Description:</label>
            <textarea id="description" value={description} onChange={handleDescriptionChange} style={{ width: '100%', padding: '10px', borderRadius: '4px', border: '1px solid #ddd', resize: 'none', height: '150px' }} />
          </div>
          <div style={{ textAlign: 'center' }}>
            <button type="submit" style={{ backgroundColor: '#3498db', color: 'white', border: 'none', padding: '10px 20px', borderRadius: '5px', cursor: 'pointer' }} disabled={isSubmitting}>
              {isSubmitting ? 'Submitting...' : 'Submit'}
            </button>
          </div>
        </form>
      </div>
    </div>
  );
}

export default Report;
